import profile from "./profile.jpg";
import "../index.css"

export default function Home() {
  const images = {
    width: "200px", 
    height: "200px", 
    objectFit: "cover",
    border: "5px solid gray"
  };

  return (
    <div className="container">
      <div class="container aos-init aos-animate a" data-aos="fade-up" data-aos-delay="100">
        <h2>Alex Smith</h2>
        <p>I'm 
          <span class="typed" data-typed-items="Designer, Developer, Freelancer, Photographer">Developer</span>
          <span class="typed-cursor typed-cursor--blink" aria-hidden="true">|</span>
          <span class="typed-cursor typed-cursor--blink" aria-hidden="true"></span>
          <span class="typed-cursor typed-cursor--blink" aria-hidden="true"></span>
        </p>
      </div>
      <div className="a">
        <h1 className="display-4">Hi, I'm Ashish ðŸ‘‹</h1>
        <p className="lead mt-3">
          Web Developer | DSA Enthusiast | Tech Explorer
        </p>
      </div>
     <img className="rounded-circle b" style={images} src={profile} alt="..." />
    </div>
  );
}
